import{_ as e,o as t,c as o,V as n}from"./chunks/framework.98960eec.js";const k=JSON.parse('{"title":"Front of House - Check In & Out","description":"","frontmatter":{},"headers":[],"relativePath":"guide/front-of-house/check-in-out.md","filePath":"guide/front-of-house/check-in-out.md"}'),a={name:"guide/front-of-house/check-in-out.md"},r=n('<h1 id="front-of-house-check-in-out" tabindex="-1">Front of House - Check In &amp; Out <a class="header-anchor" href="#front-of-house-check-in-out" aria-label="Permalink to &quot;Front of House - Check In &amp;amp; Out&quot;">​</a></h1><p>Unlike <a href="/guide/front-of-house/arrivals.html">Front of House Arrivals</a> the quick check in &amp; out functions do not return search results when performing a search either by entering text in the search field or scanning a barcode or QR code.</p><p>These functions also restrict the search terms to only digitial ticket, event pass and wristband codes as well as unique ticket IDs. You cannot search by delegate name or order reference.</p><p>If 1 result is found, the operation to check in or out that ticket from the venue, through the selected entrance, will be carried out.</p><p>If 0 or more than 1 result is found, an error will be returned indicating that the check in or out operation could not be performed.</p><div class="tip custom-block"><p class="custom-block-title">Use Case</p><p>These check in and out functions are primarily tailored around quickly checking people into and out of venues where it is not necessary to know any details about the people other than that they do or do not have a ticket for the event.</p></div><h2 id="venues-entrances-exits" tabindex="-1">Venues &amp; Entrances/Exits <a class="header-anchor" href="#venues-entrances-exits" aria-label="Permalink to &quot;Venues &amp; Entrances/Exits&quot;">​</a></h2><p>Like the Arrivals feature you can select which venue you are checking people into and out of as well as the entrance/exit (where a venue has multiple entrances or exits).</p><p>These are set within the Venues area of the event manageent backend.</p>',9),s=[r];function i(c,h,u,l,d,p){return t(),o("div",null,s)}const m=e(a,[["render",i]]);export{k as __pageData,m as default};
